import React from 'react';
import HistoryTable from '../components/HistoryTable';

const HistoryTab = () => {
  return (
    <div>
      <h2 className="text-xl font-bold mb-4">Quiz History</h2>
      <HistoryTable />
    </div>
  );
};

export default HistoryTab;
